import React, { useState, useEffect } from "react"



const GetOnePokemonInWeb = () => {


const [movimentos,setMove] = useState([])
const [data,setData] = useState()


    const list = () => {
        api.get(`/pokemon/pokemon-in-web/2/`)
            .then((response) => {
                const { moves } = response.data;
                setData(moves)

            })




    }












    return (

        <div>


            <button onClick={list}>testes</button>

            {data.map((item) => {
                    const { move,name } = item;
                    return (
                        <div key={move}>
                            <h1>Id pokemon: {name}</h1>      
                        </div>
                    );

                })}




        </div>




    )
}

export default GetOnePokemonInWeb;
